import {
  Layout,
  Menu,
  Input,
  Row,
  Col,
  Button,
  Modal,
  Card,
  Table,
  Checkbox,
  Space,
  Typography
} from 'antd'
import './ClaimPage.css'
import {
  BellOutlined,
  UserOutlined,
  LogoutOutlined,
  PlusOutlined,
  DownloadOutlined,
  EyeOutlined
} from '@ant-design/icons'
import logo from '../../Assets/download.png'
import { Pie } from '@ant-design/charts'

export const ClaimPage = () => {
  const { Header, Content, Footer } = Layout

  const { Title } = Typography

  const data = [
    {
      type: 'Medical',
      value: 27
    },
    {
      type: 'Meal',
      value: 25
    },
    {
      type: 'Transport',
      value: 18
    },
    {
      type: 'Dental',
      value: 15
    },
    {
      type: 'Misc.',
      value: 10
    }
  ]

  const dataSource = [
    {
      key: '1',
      refer: '2021OCT_HCI',
      year: '2021',
      month: 'October',
      from: "01-10-2021",
      to: "31-10-2021"

    },
    {
      key: '2',
      refer: '2021SEPT_HCI',
      year: '2021',
      month: 'September',
      from: "01-09-2021",
      to: "30-09-2021"
    },
    {
      key: '3',
      refer: '2021AUG_HCI',
      year: '2021',
      month: 'August',
      from: "01-08-2021",
      to: "31-08-2021"
    },
    
  ]

  const columns = [
    {
      title: 'PaySlip Reference',
      dataIndex: 'refer',
      key: 'refer'
    },
    {
      title: 'Year',
      dataIndex: 'year',
      key: 'year'
    },
    {
      title: 'Month',
      dataIndex: 'month',
      key: 'month'
    },
    {
      title: 'Date From',
      dataIndex: 'from',
      key: 'from'
    },
    {
      title: 'Date To',
      dataIndex: 'to',
      key: 'to'
    },
    {
        title: 'Action',
        dataIndex: '',
        key: 'x',
        render: () => (
          <Button
            icon={<EyeOutlined />}
          ></Button>
        )
      }

  ]
  const config = {
    width: 200,
    height: 200,
    appendPadding: 10,
    data: data,
    angleField: 'value',
    colorField: 'type',
    radius: 0.8,
    label: {
      type: 'inner',
      content: '{name} {percentage}'
    },
    interactions: [{ type: 'pie-legend-active' }, { type: 'element-active' }]
  }
  return (
    <Layout>
      <Header style={{ background: '#fff' }}>
        <img className='logo' src={logo} />
        <div style={{ fontWeight: 700 }}>WELCOME AH BOY</div>
      </Header>
      <Row style={{ background: '#001529' }}>
        <Col span={12}>
          <Menu
            theme='dark'
            style={{ marginTop: 10 }}
            mode='horizontal'
            defaultSelectedKeys={['1']}
          >
            <Menu.Item className='items'>Home</Menu.Item>
            <Menu.Item className='items'>Leaves</Menu.Item>
            <Menu.Item className='items'>Claims</Menu.Item>
            <Menu.Item className='items'>Payslips</Menu.Item>
          </Menu>
        </Col>
        <Col span={3}>
          <Button
            className='avatar'
            icon={<LogoutOutlined />}
            style={{ background: '#c4c4c4' }}
          >
            Log Out
          </Button>

          {/*<Dropdown overlay={menu} placement='bottomLeft'>
        <Avatar className='avatar' icon={<UserOutlined />} />
  </Dropdown>*/}
        </Col>
      </Row>
      <Content className='layout'>
        <Row
          style={{ background: '#fff', justifyContent: 'center', height: 400 }}
        >
          <Pie {...config} />
        </Row>
        <Row>
          <Table
            dataSource={dataSource}
            columns={columns}
            pagination={false}
            scroll={{ y: 350 }}
          />
        </Row>
      </Content>
    </Layout>
  )
}

export default ClaimPage
